		 BITS 32

		 GLOBAL _M68000_RUN
		 GLOBAL _M68000_RESET
		 GLOBAL _M68000_regs
		 GLOBAL _M68000_COMPTABLE
		 GLOBAL _M68000_OPCODETABLE
		 EXTERN _m68k_ICount
		 EXTERN _a68k_memory_intf
		 EXTERN _mem_amask
; Vars Mame declares / needs access to

		 EXTERN _mame_debug
		 EXTERN _illegal_op
		 EXTERN _illegal_pc
		 EXTERN _OP_ROM
		 EXTERN _OP_RAM
		 EXTERN _opcode_entry
		 EXTERN _m68k_illegal_opcode
		 SECTION .text

_M68000_RESET:
		 pushad

; Build Jump Table (not optimised!)

		 lea   edi,[_M68000_OPCODETABLE]		; Jump Table
		 lea   esi,[_M68000_COMPTABLE]		; RLE Compressed Table
		 mov   ebp,[esi]
		 add   esi,byte 4
RESET0:
		 mov   eax,[esi]
		 mov   ecx,eax
		 and   eax,0xffffff
		 add   eax,ebp
		 add   esi,byte 4
		 shr   ecx,24
		 jne   short RESET1
		 movzx ecx,word [esi]		; Repeats
		 add   esi,byte 2
		 jecxz RESET2		; Finished!
RESET1:
		 mov   [edi],eax
		 add   edi,byte 4
		 dec   ecx
		 jnz   short RESET1
		 jmp   short RESET0
RESET2:
		 popad
		 ret

		 ALIGN 4

_M68000_RUN:
		 pushad
		 mov   esi,[R_PC]
		 mov   edx,[R_CCR]
		 mov   ebp,dword [_OP_ROM]
; Check for Interrupt waiting

		 test  [R_IRQ],byte 07H
		 jne   near interrupt

IntCont:
		 test  dword [_m68k_ICount],-1
		 js    short MainExit

		 movzx ecx,word [esi+ebp]
		 jmp   [_M68000_OPCODETABLE+ecx*4]
		 ALIGN 4

MainExit:
		 mov   [R_PC],esi		; Save PC
		 mov   [R_CCR],edx
		 test  byte [R_SR_H],20H
		 mov   eax,[R_A7]		; Get A7
		 jne   short ME1		; Mode ?
		 mov   [R_USP],eax		;Save in USP
		 jmp   short MC68Kexit
ME1:
		 mov   [R_ISP],eax
MC68Kexit:
		 mov   eax,edx
		 mov   ah,byte [R_XC]
		 mov   ECX,edx
		 and   ECX,byte 1
		 shr   eax,4
		 and   eax,byte 01Ch 		; X, N & Z

		 or    eax,ECX 				; C

		 mov   ECX,edx
		 shr   ECX,10
		 and   ECX,byte 2
		 or    eax,ECX				; O

		 mov   ah,byte [R_SR_H] 	; T, S & I

		 mov   [R_SR],eax

		 popad
		 ret
		 ALIGN 4

; Interrupt check

interrupt:
		 mov   eax,[R_IRQ]
		 and   eax,byte 07H
		 cmp   al,7		 ; Always take 7
		 je    short procint

		 mov   ebx,[R_SR_H]		; int mask
		 and   ebx,byte 07H
		 cmp   eax,ebx
		 jle   near IntCont

		 ALIGN 4

procint:
		 and   byte [R_IRQ],78h		; remove interrupt & stop

		 push  eax		; save level

		 mov   ebx,eax
		 mov   [R_CCR],edx
		 push  eax		; irq line #
		 call  dword [R_IRQ_CALLBACK]	; get the IRQ level
		 lea   esp,[esp+4]
		 mov   edx,[R_CCR]
		 test  eax,eax
		 jns   short AUTOVECTOR
		 mov   eax,ebx
		 add   eax,byte 24		; Vector

AUTOVECTOR:

		 call  Exception

		 pop   eax		; set Int mask
		 mov   bl,byte [R_SR_H]
		 and   bl,0F8h
		 or    bl,al
		 mov   byte [R_SR_H],bl

		 jmp   IntCont

		 ALIGN 4

Exception:
		 push  edx		; Save flags
		 and   eax,0FFH		; Zero Extend IRQ Vector
		 push  eax		; Save for Later
		 mov   al,[exception_cycles+eax]		; Get Cycles
		 sub   [_m68k_ICount],eax		; Decrement ICount
		 mov   eax,edx
		 mov   ah,byte [R_XC]
		 mov   ECX,edx
		 and   ECX,byte 1
		 shr   eax,4
		 and   eax,byte 01Ch 		; X, N & Z

		 or    eax,ECX 				; C

		 mov   ECX,edx
		 shr   ECX,10
		 and   ECX,byte 2
		 or    eax,ECX				; O

		 mov   ah,byte [R_SR_H] 	; T, S & I

		 mov   edi,[R_A7]		; Get A7
		 test  ah,20H	; Which Mode ?
		 jne   short ExSuperMode		; Supervisor
		 or    byte [R_SR_H],20H	; Set Supervisor Mode
		 mov   [R_USP],edi		; Save in USP
		 mov   edi,[R_ISP]		; Get ISP
ExSuperMode:
		 sub   edi,byte 6
		 mov   [R_A7],edi		; Put in A7
		 mov   [R_PC],ESI
		 push  EAX
		 push  EDI
		 call  [_a68k_memory_intf+20]
		 lea   esp,[esp+8]
		 add   edi,byte 2
		 mov   [R_PC],ESI
		 push  ESI
		 push  EDI
		 call  [_a68k_memory_intf+24]
		 lea   esp,[esp+8]
		 pop   eax		;Level
		 shl   eax,2
		 add   eax,[R_VBR]
		 mov   [R_PC],ESI
		 push  EAX
		 call  [_a68k_memory_intf+12]
		 lea   esp,[esp+4]
		 mov   esi,eax		;Set PC
		 pop   edx		; Restore flags
		 test  esi, dword 1
		 jz    near OP0_00001
		 sub   esi,byte 2
		 mov   al,3
		 call  Exception

		 test  dword [_m68k_ICount],0xffffffff
		 jle   near MainExit


		 test    byte [_mame_debug],byte 0xff
		 jnz   near MainExit

		 movzx ecx,word [esi+ebp]
		 jmp   [_M68000_OPCODETABLE+ecx*4]

