		 mov   [FullPC],ESI
		 and   esi,[_mem_amask]
		 mov   [R_CCR],edx
		 push  esi
		 call  [_a68k_memory_intf+28]
		 lea   esp,[esp+4]
		 mov   edx,[R_CCR]
